import React, { Component } from 'react';

class ListaDeCategorias extends Component {
    render() {
        return (
            <section>
                <ul>
                    <li>Categorias</li>
                    <li>Categorias</li>
                    <li>Categorias</li>
                </ul>
                <input type="text" />
            </section>
        );
    }
}

export default ListaDeCategorias;
